import { CREATE_NEW_WELL } from "../ActionCreators/types"

const INITIAL_STATE = {
  response: {},
  status: '',
}

export default (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case CREATE_NEW_WELL:
      return {...state, response: action.payload, status: 'received'}
    default:
      return state
  }
}
